import './App.css';
import {Route, Switch, Redirect} from 'react-router-dom';
import {Home} from './pages';

function App() {
  return (
    <div>
      <Switch>
          <Route path="/" component={Home} exact />
      </Switch>
    </div>
  );
}

export default App;
